import styled from "@emotion/styled";

export const HeaderTitle = styled.div`
  margin-bottom: 2em;
`;

export const MainTitle = styled.h1`
padding-right:70px; 
  margin-bottom: 0.5em;
`;

export const SubTitle = styled.p`
  margin-bottom: 0.5em;
`;

export const SearchContainer = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;
